import Modal from "react-bootstrap/Modal";
import "bootstrap/dist/css/bootstrap.min.css";

function modal(props) {

    return (
        <Modal show={false}>
            <Modal.Header closeButton>
                <Modal.Title>preencher</Modal.Title>
            </Modal.Header>
            <Modal.Body>
                preencher
            </Modal.Body>
            <Modal.Footer>
                footer
                {/* <Button variant="seconday" onClick={props.onHide}>Close</Button> */}
            </Modal.Footer>
        </Modal>
    );
}

export default ModalS;
